import moment from 'moment'
 
 export class User {

    constructor(id,username, gender, date, phoneNumber, email) {

        this.id = id;
        this.username = username ;
        this.gender = gender;
        this.date = moment(date).format('YYYY-MM-DD');
        this.phoneNumber = phoneNumber;
        this.email = email;

    }

    copyConstructor(Other){

        this.id = Other.id;
        this.username = username ;
        this.gender = gender;
        this.date = moment(date).format('YYYY-MM-DD');
        this.phoneNumber = phoneNumber;
        this.email = email;

    }

  }
